CREATE TABLE data (
    `businesses_id` VARCHAR(67) CHARACTER SET utf8,
    `businesses_name` VARCHAR(51) CHARACTER SET utf8,
    `businesses_image_url` VARCHAR(68) CHARACTER SET utf8,
    `businesses_is_closed` VARCHAR(5) CHARACTER SET utf8,
    `businesses_url` VARCHAR(224) CHARACTER SET utf8,
    `businesses_review_count` INT,
    `businesses_categories_alias` VARCHAR(20) CHARACTER SET utf8,
    `businesses_categories_title` VARCHAR(25) CHARACTER SET utf8,
    `businesses_rating` NUMERIC(2, 1),
    `businesses_coordinates_latitude` NUMERIC(12, 10),
    `businesses_coordinates_longitude` NUMERIC(12, 9),
    `businesses_price` VARCHAR(4) CHARACTER SET utf8,
    `businesses_location_address1` VARCHAR(29) CHARACTER SET utf8,
    `businesses_location_address2` VARCHAR(18) CHARACTER SET utf8,
    `businesses_location_address3` VARCHAR(35) CHARACTER SET utf8,
    `businesses_location_city` VARCHAR(14) CHARACTER SET utf8,
    `businesses_location_zip_code` INT,
    `businesses_location_country` VARCHAR(2) CHARACTER SET utf8,
    `businesses_location_state` VARCHAR(2) CHARACTER SET utf8,
    `businesses_location_display_address` VARCHAR(35) CHARACTER SET utf8,
    `businesses_phone` INT,
    `businesses_display_phone` VARCHAR(14) CHARACTER SET utf8,
    `businesses_distance` NUMERIC(15, 10),
    `businesses_transactions` VARCHAR(22) CHARACTER SET utf8
